AME}.bundle\" \"./${BUNDLE_NAME}.bundle\"\n\n# re-direct to the Documentation folder and build the Documentation\n# cd Documentation\n# xcodebuild -project \"Documentation.xcodeproj\" -scheme \"AppleDoc\"\n# cd ..\n\n# Create binary\nzip -r ./AnnotationKit.zip OTAnnotationKitStatic.framework OTAnnotationKitBundle.bundle\n\n# Delete the most recent build.\nif [ -d \"${SRCROOT}/${FRAMEWORK_NAME}.framework\" ]; then\nrm -rf \"${SRCROOT}/${FRAMEWORK_NAME}.framework\"\nfi\n\nif [ -d \"${SRCROOT}/${BUNDLE_NAME}.bundle\" ]; then\nrm -rf \"${SRCROOT}/${BUNDLE_NAME}.bundle\"\nfi\n\nif [ -d \"${SRCROOT}/build\" ]; then\nrm -rf \"${SRCROOT}/build\"\nfi";
